INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(2, '   Kothokan Nila Pedas', '1 kg ikan nila, buang kotoran dan sisiknya, bersihkan <br/>\r\n3 lembar daun jeruk <br/>\r\n1 ruas kecil lengkuas <br/>\r\n1 buah tomat <br/>\r\nsecukupnya Santan\r\nsecukupnya Garam, gula dan kaldu bubuk <br/>\r\nBumbu Halus :\r\n8 siung bawang merah 6 siung bawang putih\r\n100 gr cabe rawit (sesuai selera) <br/>\r\n4 butir kemiri <br/>\r\n1/2 sdt ketumbar bubuk <br/>\r\n1 ruas kecil kunyit <br/>\r\n1 ruas kecil jahe', '1. Goreng ikan nila sampai kering, angkat dan tiriskan <br/>\r\n2. Goreng bumbu, haluskan dan tumis dengan ditambahkan  <br/>daun jeruk dan lengkuas. Tumis sampai harum. Beri air secukupnya  <br/>\r\n3. Masukkan tomat, daun bawang, santan, gula, garam dan kaldu bubuk. Aduk hingga rata <br/>\r\n4. Masukkan ikan nila goreng, biarkan sampai kuah mendidih <br/>\r\n5. Angkat dan sajikan <br/>', 'Kothokan ikan nilai pedas merupakan salah satu olahan tradisional dari Jawa Tengah. ', , '5', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(4, 'Nasi gemuk', '700 gr beras\r\n1 liter santan sedang\r\n1 buah sereh\r\n2 lembar daun salam\r\nBumbu halus:\r\n3 siung bawang putih\r\n1 sdt ketumbar (sy skip)\r\n1/2 sdt jinten (sy skip)\r\n1 sdt garam\r\n1 sdt kaldu jamur\r\nLauk pelengkap:\r\nTeri goreng\r\nKacang tanah goreng\r\nTempe goreng kering\r\nBakwan jagung\r\nTimun\r\nBawang goreng\r\nTumis tempe buncis kecap (lihat resep)\r\nSambel', 'Langkah\r\nSiapkan bahan2nya, cuci bersih beras. Uleg bumbu. Geprek sereh\r\nMasukkan semua bahan kedalam panci rice cooker, aduk agar bumbu tercampur rata, tes tingkat asinnya, jk msh merasa kurang boleh ditambah.\r\nNyalakan rice cooker dan masak seperti memasak nasi pada umumnya. Jika matang sajikan dengan lauk pelengkap dan sambel.', 'Nasi gemuk dimasak dengan santan kelapa dan daun pandan yang merupakan hidangan khas Jambi. ', , '4', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(5, 'Bubur Manado', 'Sebakul Nasi yang sudah Masak\r\n1 ikat Bayam Hijau\r\n6 btg Kacang Panjang\r\n¹/4 ptg Labu Kuning\r\nSecukupnya Daun Kemangi\r\n1 bj Jagung Kuning (dipipil)\r\n1 sc Bumbu Magic + ¹/2 sdm Garam Halus\r\nSedikit Kunyit (Biar tidak pucat)\r\nBatang sereh + Daun Salam, Daun Jeruk\r\nAir Matang\r\nPelengkap ;\r\nIkan Kering Asin\r\nSambal Terasi\r\nBumbu Halus ;\r\n6 bj Bawang Putih\r\n3 bj Bawang Merah\r\n2 btr Kemiri\r\nSecukupnya Lada', 'Langkah\r\nPotong dan cuci bersih semua bahan. Sisihkan\r\nUlek semua bahan halus kemudian tumis hingga wangi\r\nMasukan nasi dalam panci dan beri air hingga nasi terendam. Biarkan hingga didih, sesekali diaduk biar tidak hangus dibagian bawahnya. Tambahkan juga sereh dan duo daun.\r\nKemudian masukan bumbu tumis dan juga jagung. Jangan lupa tuk diaduk yakk. Tunggu sampai jagung lunak. Tambahkan larutan kunyit bubuk agar buburnya tdk pucak. \r\nSetelah itu tambahkan labu dan sayur lainnya. Jika nasi masih terlihat keras bisa ditambahkan air secukupnya. Kemudian tambahkan bumbu penyedap sambil diaduk terus. Masak hingga mateng yg diinginkan.\r\nIkan keringnya jangan lupa dipotong dan dicuci bersih yk, truus digoreng hingga kecoklatan.', 'Bubur manado dibuat dari beras yang dicampur dengan aneka bumbu dan sayuran', , '3', 'pembuka');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(6, 'Perkedel Udang Jagung', '1 buah jagung manis\r\n60 gr udang, cincang halus\r\n1/2 buah wortel\r\n1 helai daun bawang, iris tipis\r\n1 butir telur\r\n1 sdm terigu\r\n2 sdm keju cheddar parut\r\n1 siung bawang merah, cincang halus\r\n1 siung bawang putih, cincang halus\r\n1 sdt kaldu bubuk\r\nsecukupnya lada\r\nsecukupnya garam', 'Langkah\r\nParut jagung dan wortel menggunakan parutan keju\r\nTambahkan udang cincang, daun bawang, keju, terigu dan telur\r\nBumbui dengan bawang merah dan bawang putih cincang, kaldu bubuk, lada dan garam secukupnya, lalu aduk hingga rata\r\nGoreng dengan api sedang hingga matang kecoklatan\r\nSiap disajikan', 'Perkedel udang jagung adalah masakan khas rumahan yang banyak ditemui di Indonesia', , '5', 'pembuka');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(7, 'Es Krim dgn Pondan', '2 bungkus pondan\r\n400 ml air es\r\n4 buah strawberry iris kecil', 'Tuangkan 1 bungkus pondan rasa coklat. Tambahkan air es 200 ml. Mixer dgn kecepatan tinggi selama 5-10 menit\r\nKemudian tuang di wadah, dan sisihkan satu sisi untuk rasa strawberry\r\nLakukan hal yg sama untuk rasa strawberry. Setelah mengental beri irisan buah strawberry, aduk rata.\r\nKemudian tuang di satu sisi wadah. Freezer kurleb 5 jam atau lebih. Siap', 'Sore ini enaknya makan es krim. Es krim buatan sendiri lebih aman ketimbang membeli!', , '4', 'penutup');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(8, 'Sarang Semut / Bolu Karamel', 'Susu kental manis 1sct\r\n100 gr Margarine\r\nKaramel\r\n300 gr Gula pasir\r\n300 ml Air panas\r\nBahan kering\r\n80 gr Tepung kanji\r\n130 gr Terigu serbaguna\r\n1 sdm Soda kue\r\n1 bks Vanili', 'Langkah\r\nLelehkan separuh gula dengan api sedang, masukan air panas, Jika sdh mendidih masukan sisa gula aduk sampai larut, angkat, dinginkan\r\nCampur semua bahan kering ayak/saring\r\nLelehkan margarin\r\nDi wadah lain Aduk telur + SKM sampai rata, aduk hanya 1 Arah (kalau kanan terus kanan, kalau Kiri terus kiri) bisa menggunakan whisk atau garpu\r\nMasukan perlahan bahan kering yg sdh di saring sampai tercampur rata (aduk dengan arah yg sama seperti telur)\r\nMasukan margarine yg sdh di lelehkan, di aduk sama arah dengan di atas sampai tercampur rata\r\nMasukan Karamel yg sdh dingin perlahan dan searah dengan adukan pertama sampai tercampur\r\nPanaskan oven suhu 180’c\r\nSemir Loyang dengan mentega dan taburi tepung, masukan adonan, panggang selama 30menit', 'Bolu Karamel disebut Kue sarang semut karena memiliki bentuk berongga menyerupai sarang semut.', , '4', 'penutup');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(9, 'Roti Telur', 'Bahan\r\n1 butir telur\r\n1 lembar roti\r\nsedikit mayonaise\r\nsejumput garam\r\nsedikit saus tomat', 'Langkah\r\nSiapkan bahan\r\nRoti Telur langkah memasak 1 foto\r\nKocok telur dan garam\r\nRoti Telur langkah memasak 2 foto\r\nMemasak telur\r\nRoti Telur langkah memasak 3 foto\r\nSusun telur di atas roti tambahkan mayonaise dan saus tomat. roti telur siap di santap.', 'Menu makanan sarapan yang dapat dibuat dengan mudah dan bahan yang simpel', , '3', 'pembuka');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(10, 'Indomie telur kornet', 'Indomie (rasa sesuai selera)\r\n2 sendok makan Kornet\r\n1 buah Telur\r\n2 buah Bawang putih\r\nCabai (cengek) 4 buah (sesuai selera?\r\nNori (buat taburan aja)\r\n2 sendok makan Minyak goreng\r\n1 sendok makan Saos tiram\r\n1/2 sendok teh Garam\r\n150 cc Air', 'Langkah\r\nTumis bawang putih sampe wangi\r\nMasukan kornet dan di aduk - aduk\r\nMasukan telur, lalu di orak arik\r\nMasukan saus tiram dan garam\r\nMasak sampai mateng, atau kecium wangi\r\nMasukan air dan indomie\r\nTunggu sampe mie sedikit mateng\r\nMasukan cabe yang udah di iris, diaduk\r\nMatikan kompor, masukan bumbu indomie (diaduk)\r\nTerakhir kasih toping nori', 'Kombinasi dari indomie, telur, dan kornet yang menggugah selera dan dengan harga terjangkau.', , '5', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(11, 'Nasi Goreng Mawut', '3 sendok makan minyak goreng\r\n100 gr dada ayam (cincang kasar)\r\n50 gr bakso (potong sesuai selera)\r\n1 btr telur\r\n200 gr nasi putih\r\n100 gr mie basah\r\n1 bungkus Kobe Bumbu Nasi Goreng Poll Pedas\r\n1 sendok makan kecap manis\r\n50 gr sawi hijau (iris sepanjang 2 ruas jari)\r\n50 gr kol (iris-iris)', 'Panaskan 3 sendok makan minyak goreng, lalu tumis dada ayam hingga berubah warna.\r\nMasukan bakso dan telur. Masak hingga matang.\r\nMasukan nasi putih, mie basah lalu aduk hingga rata\r\nTambahkan 1 bungkus Kobe Bumbu Nasi Goreng Poll Pedas, 1 sendok makan kecap manis, aduk hingga rata.\r\nMasukan irisan sawi dan kol. Aduk kembali hingga tercampur rata.\r\nAngkat dan sajikan selagi hangat.', 'Nasi Goreng Mawut merupakan makanan khas Indonesia yang bisa dijadikan makanan tunggal.', , '5', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(12, 'Tempe Jamur Saos Tiram', '1 papan tempe, potong dadu\r\nMinyak utk menggoreng\r\nBumbu :\r\n1/2 bh bawang bombay, iris2\r\n2 bh baput, iris2\r\n7 bh cabai keriting, sy campur merah & ijo, iris2\r\n1 ruas kecil jahe, sy ga pake\r\n1/2 sdm bumbu dasar putih halus (lihat resep)\r\n3 kuntum jamur kuping, iris2\r\n4 sdm saos tiram\r\n2 sdm kecap manis\r\nSejumput lada halus\r\n1 sdt kaldu royco\r\n100 ml air', 'Potong dadu tempe, lalu goreng diminyak panas\r\nSiapkan bumbu, tumis bumbu2 irisnya, hingga harum lalu masukkan bumbu halusnya, jamur, tumis lagi, masukkan tempe goreng, beri saos tiram, kecap, kaldu, lada & air. Aduk (lihat resep)\r\nAduk2 hingga tercampur rata, Masak sampai air susut, koreksi rasa & sajikan', 'Buat kalian yang suka dengan olahan jamur, bisa coba resep Tempe Jamur Saos Tiram ini!', , '2', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(13, 'Kwetiau', '5 buah bakso sapi, belah jadi 4\r\n1 buah wortel, iris serong\r\n50 gram brokoli, siangi\r\n2 siung bawang putih, cincang\r\n1/4 buah bombay, cincang\r\n200 ml air kaldu\r\n1 butir telur, kocok lepas\r\n5 buah cabe rawit utuh\r\n1 sdm kecap manis\r\n1/4 sdt merica bubuk\r\nsecukupnya garam dan kaldu jamur\r\n4 sdm minyak untuk menumis', 'Rebus kwetiau, sampai matang, tiriskan, susun dipiring saji.\r\nPanaskan minyak, masukkan telur, buat orak arik, sisihkan di pinggir wajan. Masukkan bawang putih dan bombay, tumis sampai harum.\r\nLanjut masukkan wortel dan brokoli, tumis sampai setengah matang. Tambahkan semua sisa bahan biarkan mendidih, cicipi rasa, angkat.\r\nSiramkan sayuran di atas kwetiau, sajikan panas-panas.', 'Kwetiau adalah makanan populer sejenis mi Tionghoa berwarna putih yang terbuat dari beras. ', , '1', 'penutup');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(14, 'Ayam Bakar Teflon', '1 kg daging ayam\r\nSecukupnya air untuk ngungkep\r\n1/2 buah jeruk nipis\r\nBumbu halus:\r\n8 siung bawang merah\r\n5 siung bawang putih\r\n4 butir kemiri, sangrai\r\n1 sdt ketumbar, sangrai\r\n1/2 sdt merica, sangrai\r\n1/4 sdt jinten, sangrai (aku gak pakai)\r\n1 ruas kunyit\r\n1 ruas jahe\r\nBumbu lainnya:\r\n2 batang serai, memarkan\r\n1 ruas lengkuas, memarkan\r\n4 lembar daun salam\r\n5 lembar daun jeruk\r\n2 sdm gula merah, sisir\r\n1 sdm air asam Jawa\r\n4 sdm kecap manis\r\nSecukupnya garam, gulpas, dan kaldu bubuk', 'Lumuri ayam dgn jeruk nipis dan garam, sisihkan.\r\nSangrai ketumbar, kemiri, dan merica terlebih dahulu, lalu haluskan bersama dengan bumbu halus lainnya.\r\nSiapkan wajan dan tata ayam diatasnya, tuang bumbu halus, lalu beri daun salam, daun jeruk, serai, dan lengkuas. Kemudian masukkan air secukupnya. Tutup dan ungkep hingga airnya sedikit menyusut.\r\nMasukkan air asam Jawa, kecap manis, gula merah, gula pasir, garam, dan kaldu bubuk, aduk rata dan ungkep lagi hingga bumbunya meresap.\r\nSetelah itu tiriskan ayam.\r\nSiapkan teflon anti lengket, lalu bakar ayam. Untuk bumbu olesnya pakai bumbu sisa ungkep tadi dan beri sedikit margarin. Bolak-balik ayam hingga matang merata.\r\nLakukan hingga semua ayam habis.\r\nSajikan bersama nasi hangat, sambal, dan lalapan.?? Selamat mencoba ??', 'Membuat ayam bakar cukup siapkan daging ayam & peralatan bakarnya yang bisa menggunakan teflon.', , '4', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(15, 'Ayam Goreng Lombok Ijo', '250 gr ayam yang sudah dibumbui, goreng, sisihkan\r\n2 siung bawang putih\r\n10 siung bawang merah\r\n5 buah cabe ijo besar\r\n10 buah cabe rawit ijo\r\nSejempol lengkuas geprek\r\n2 lembar daun jeruk\r\n1 batang serai geprek\r\nsecukupnya Gula garam dan kaldu bubuk\r\nsecukupnya Air', 'Rebus semua bahan kecuali daun jeruk serai dan lengkuas\r\nSetelah layu masukkan kedalam Cooper,untuk tekstur sesuai selera\r\nTumis bumbu halus bersama daun jeruk serai dan lengkuas hingga harum\r\nMasukkan air sedikit\r\nBeri gula garam dan kaldu bubuk secukupnya\r\nKoreksi rasa\r\nMasukkan ayam aduk rata\r\nMasak hingga semua tercampur\r\nSiap disajikan', 'Ayam Goreng Lombok Ijo ini berasal dari Sumatera Barat yang pastinya menggiurkan selera', , '3', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(16, 'Kari ikan asep pari & tahu', '1/2 kg ikan pari yg sudah di asep potong jd 6 biji\r\n1 liter santan segar\r\nBumbu yg di haluskan:\r\n6 buah cabe merah kriting bisa pake cabe Merah besar jg\r\n7 buah cabe rawit boleh lbh tergantung selera\r\n3 siung bawang putih\r\n6 buah bawang merah\r\nsecukupnya Ketumbar\r\nsecukupnya Merica\r\n1 cm Kunyit\r\nsecukupnya Kencur\r\n4 buah kemiri\r\nBahan cemplung :\r\nLaos di geprek\r\nDaun salam\r\nDaun jeruk\r\n4 buah Tahu yg sudah di goreng', 'Haluskan bumbu,tumis hingga matang\r\nMasukan santan,tahu,ikan asep,daun jeruk,daun salam,lengkuas tunggu smpai mendidih smbil di aduk2 agar santan tidak pecah...\r\nTunggu smpai benar2 mendidih ya agar ga cepet basi...dan kari ikan asep tahu pedas siap di santap...', 'Untuk kalian pencinta ikan pari, sangat cocok untuk mencoba resep ini, pasti sangat lahap!', , '3', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(17, 'Sup udang ala Korea', '4 buah udang pancet besar\r\n1 buah cukini\r\n100 gram kimchi\r\n5 lembar sawi putih\r\n1 bungkus jamur enoki\r\n1 buah tofu\r\n2 batang bawang daun\r\n1 sdm kecap ikan\r\n1 sdm bumbu merah (gocujang)\r\n1 sdt tomat pasta\r\n1 sdt kaldu jamur\r\n1 liter air', 'Siapkan bahan2, cuci bersih udang pisahkan kepala nya,potong2 bulat tofu dan cukini,potong2 sawi,bawang daun dan buang akar enok\r\nDidihkan air dan rebus kepala udang sampai kaldu nya keluar wangi (setelah mendidih masak dengan api kecil tutup) kemudian masukan bumbu merah,tomat pasta dan kimchi\r\nMasukan semua sayuran tofu,dan udang,tambahkan kaldu jamur dan kecap ikan,masak sampai semua bahan matang\r\nSajikan selagi panas lebih nikmat', 'Pencinta masakan korea cocok nih untuk mencoba resep udang ini, serasa makan di korea!', , '5', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(18, 'Arsik ikan mujair', '400 gram ikan mujair (5 ekor)\r\n2 batang serai, geprek\r\n1 ruas lengkuas, setengah ruas di blender, setengah lagi di geprek\r\n1/2 sdt lada bubuk\r\nSesuai selera bawang batak (bisa diganti dengan kacang panjang/daun ubi)\r\n3 lembar daun salam\r\n1 genggam andaliman, di giling kasar/di blender\r\n2 buah asam cikala/siala, geprek\r\n2 buah asam potong (skip, karna kehabisan)\r\nSecukupnya air\r\nSecukupnya garam\r\nBahan blender\r\n6 siung bawang merah\r\n3 siung bawang putih\r\n3 butir kemiri\r\n1 sdt bubuk kunyit (atas sesuai selera untuk warna kuning nya), bisa juga pakai kunyit\r\n1 cm jahe\r\n5 buah cabai merah (bisa ditambah sesuai selera atau ditambah cabe rawit)\r\n1 buah tomat', 'Siapkan bahan\r\nSiapkan kuali. Susun serai, lengkuas, asam cikala, daun salam dan andaliman sebagai dasar. Susuh ikan diatasnya. Lalu bawang batak (di susun juga di antara ikan) dan bumbu yg dihaluskan + bubuk kunyit diatas ikan. Masukkan air sampai ikan tenggelam. Taburin garam secukupnya. Tutup & hidupkan api.\r\nSetelah mendidih test rasa. Masak sampai kering atau dengan kuah sesuai selera. Siap untuk di sajikan', 'Makanan khas lidah orang Sumatera utara khususnya di pesisir Danau Toba yang bikin nambuh!', , '3', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(19, 'Ayam Bakar Kalasan', '500 gram ayam (saya pake sayap)\r\n1 buah jeruk nipis\r\n1/2 sdt garam\r\n1 buah jeruk limo\r\n2 lembar daun salam\r\n3 lembar daun jeruk, buang tulang\r\n5 sdm kecap manis\r\n1 sdt lada bubuk\r\n1/4 sdt garam\r\n1/4 sdt kaldu penyedap (opsional)\r\n400 ml air atau sesuaikan supaya ayam terendam\r\n1 sdm margarin\r\nBahan Rendaman\r\n6 siung bawang merah\r\n3 siung bawang putih\r\n3 butir kemiri\r\n1 ruas jahe\r\n1 sdt gula merah semut', 'Cuci bersih ayam lalu lumuri air jeruk nipis dan garam diamkan kurleb 15 menit, cuci bilas bersih, campur bumbu halus bersama kecap manis, lada, garam dan kaldu, masukkan ayam ke dalam bumbu lumuri hingga rata sambil diremas remas\r\nSiapkan panci, masukkan daun salam dan daun jeruk, lalu masukkan ayam di atasnya, tuang air dan rebus/ungkep ayam bersama bumbu hingga air menyusut/sat\r\nOlek panggangan dengan margarin, bolak balik skali tiap sisi, bakar ayam hingga kecoklatan kedua sisi, sajikan bersama sambal terasi\r\nKalo masih ada sisa bumbu ungkepan ayam bisa dijadikan tambahan bumbu ayam ya (lihat resep)', 'Sajian ayam bakar kalasan adalah hidangan ayam yang enak karena bumbu kalasannya itu loh!', , '4', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(20, 'Sambalado Udang Tepe & Pete', '250 gram udang, berishkan\r\n2 buah terong, potong serong\r\n1 papan pete, kupas\r\n3 lembar daun jeruk, buang tulang daunnya\r\n4 lembar daun salam\r\n1 batang sereh\r\n1 cm langkuas, geprek\r\n2 sdm kaldu instan\r\n1/2 sdt garam\r\n1 sdm gula pasir\r\n1 sdt lada bubuk\r\nSecukupnya minyak sayur\r\nBumbu Sambalado, (tumbuk kasar)\r\n3 buah cabe merah besar, buang bijinya\r\n100 gram cabe merah keriting\r\n7 buah cabe rawit (optional)\r\n10 siung bawang merah\r\n4 siung bawang putih\r\n2 buah tomat kecil', 'Siapkan semua bahan yang diperlukan\r\nKemudian siapkan wajan, panaskan minyak sayur. Goreng udang terlebih dahulu. Kemudian angkat dan tiriskan.\r\nLalu tumis semua bahan bumbu kasar hingga harum. Setelah itu, masukkan daun jeruk, daun salam, sereh, langkuasnya dan tomat hijau. Aduk hingga rata.\r\nKemudian masukkan terong aduk rata, lalu udang dan setelahnya pete. Aduh kembali hingga rata\r\nBeri bumbu dan koreksi rasanya sambil diaduk terus.\r\nSetelah itu, angkat dan pindahkan di piring... Disantam dengan nasi hangat', 'Sambalado Udang Tepe & Pete adalah masakan yang bisa disebut sudah-susah gampang tapi bisa dicoba!', , '3', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(21, 'Sarden kuah pedas', '20 cabai\r\n4 siung bawang merah\r\n2 siung bawang putih\r\nSedikit lada bubuk\r\nSarden merek apa saja\r\nMinyak goreng', 'Potong semua bahan bawang merah, bawang putih, cabai, tumbuk lada. Kemudian panaskan minyak goreng dan tumis semua bumbu hingga harum\r\nMasukkan sarden kedalam wajan sesekali diaduk sampai air sarden agak asat dan setelah dirasa matang segera sajikan', 'Yang suka ikan sarden kalengan siapa? Bisa coba nih sarden kuah pedas yang murah meriah!', , '1', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(22, 'Dimsum ayam wortel', '1 kg paha ayam giling\r\n1 buah wortel parut\r\n10 sendok makan Minyam wijen\r\n1 sdm Kecap asin\r\n1 sdm Kecap Ikan\r\n1 Sachet penyedap rasa\r\nSecukupnya lada\r\n2 buah telur\r\n8 sdm tepung tapioka\r\n6 siung bawang putih giling halus\r\nKulit pangsit', 'Ayam yang sudah digiling/cincang halus di mix dengan bahan2 yang lain kecuali minyak wijen\r\nSetelah adonan tercampur rata masukan 7 sdm minyak wijen\r\nSiapkan 1 lembar kulit pangsit dan 1 sdm adonan ayam dibagian tengah lalu tutup lipat pinggirannya rapihkan sisa lembaran kulit pangsit dengan gunting Berikan parutan wortel diatasnya\r\nSiapkan kukusan klu air sudah mendidih Adonan sudah siap dikukus selama 15 menit', 'Buat dimsum ala-ala restoran bisa nih! Langsung ikutin aja langkah-langkahnya pasti bisa!', , '2', 'pembuka');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(23, 'Puding Kacang Hijau Lumutan', 'Puding Kacang Hijau:\r\n1 sachet agar plain\r\n100 gram gula pasir\r\n700 ml santan cair\r\n1 sdm maizena\r\n2 lembar daun pandan, simpulkan\r\nSecukupnya kacang hijau matang\r\nPuding lumut pandan:\r\n1 sachet agar plain\r\n150 gram gula pasir\r\n2 butir telur, kocok lepas\r\n125 ml santan cair\r\n100 ml jus pandan (10 lembar daun pandan + air, blender, saring)\r\n600 ml air matang\r\n1/2 sdt garam\r\n1/4 sdt vanilla essence/vanili', 'Puding Kacang Hijau: campurkan semua bahan kecuali kacang hijau. Masak hingga mendidih, matikan api lalu masukkan kacang hijau, aduk rata.\r\nTuang ke dalam loyang yang sudah dibasahi dengan air. Cukup tuang sebagian saja ya. Sisihkan dan biarkan hingga setengah set di suhu ruang.\r\nPuding lumut pandan: Masukkan semua bahan dalam panci dan masak hingga mendidih dengan api sedang sambil sesekali diaduk.\r\nSetelah mendidih, kecilkan api sambil menunggu lumut terbentuk dengan sendirinya.\r\nMatikan api lalu tuang di atas layer putih. Kemudian biarkan hingga uap panasnya hilang setelah itu masukkan ke dalam kulkas supaya set. Siap untuk dinikmati ', 'Puding merupakan salah satu dessert yang mayoritas orang menyukainya. Yok bisa yok buatnya!', , '5', 'penutup');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(24, 'Tempe Mendoan', '1 papan tempe\r\n1 bungkus bumbu jadi mendoan\r\n1 batang daun bawang\r\n1/2 bungkus lada bubuk\r\n1/2 bungkus kaldu bubuk\r\n1/2 sdt gula pasir\r\n500 ml minyak goreng\r\n10 biji cabe rawit\r\nBumbu cocol\r\n5 sdm kecap manit\r\n10 biji cabe rawit tumbuk\r\n1/2 sdt gula pasir', 'Campur bahan kulit tempe..aduk rata dan tambahkan semua bumbu..dan cabe uleknya\r\nPotong2 tempe lalu celup diwadah adonan.\r\nPanaskan minyak di wajan..lalu goreng tempe nya sampe selesai...hidangkan selagi hangat', 'Gorengan memang begitu menggiurkan salah satunya mendoan yg disukai hampir semua orang', , '1', 'pembuka');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(25, 'Sosis Tahu Bakso', '1 buah tahu potong dadu\r\n2 buah sosis\r\n6 buah sosis\r\nSecukupnya tepung bumbu\r\n1/2 siung bawang bombay\r\n2 siung bawang putih\r\n5 buah cabe rawit\r\n2 sdm saus tomat\r\n2 sdm kecap manis\r\nSecukupnya garam & gula', 'Larutkan kurleb 2 sdm tepung bumbu dengan air, masukkan tahu yang sudah dipotong2, aduk sampai rata. Gulirkan ke tepung kering lalu goreng dengan minyak panas, setelah matang sisihkan\r\nPotong2 sosis & bakso sesuai selera, goreng sampai matang, sisihkan\r\nPanaskan minyak, tumis bawang bombay sampai harum, masukkan bawang putih & cabe rawit aduk hingga sedikit layu\r\nTambahkan sedikit air, beri garam, gula, saus tomat dan kecap, aduk hingga rata jangan lupa tes rasa\r\nSetelah pas, masukkan bakso, sosis, dan tahu yang sudah digoreng lalu aduk hingga rata. Selamat mencoba', 'Siapa yang suka sosis? bakso? tahu? bisa digabungin ni masaknya! Kuy langsung buka resepnya!', , '1', 'pembuka');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(26, 'Tempe Balut Smoke Beef', '200 gr Tempe (sy pakai Tempe home made)\r\n8 lembar smoke beef\r\n1 Bungkus Tepung Kobe Tempe Kriuk (210 gr)\r\n130 ml air\r\n400 gr minyak Goreng\r\n1 satchet Bon Cabe level 15 Rasa original (sy skip lagi ga Ada)', 'Siapkan Tempe dan smoke beef, Potong2 Tempe ukuran Jari, kemudian goreng hingga matang.\r\nLetakkan Tempe di atas smoke beef kemudian gulung, tusuk dengan tusuk gigi supaya tidak terlepas gulungannya.\r\nCampur 70 gr Tepung Kobe Tempe Kriuk dengan air 130 ml aduk rata hingga tidak Ada yg bergerindil. Celupkan satu persatu Tempe yg sdh digulung smoke beef kedalam tepung Kobe Tempe Kriuk Basah kemudian pindahkan kedalam tepung Kering.\r\nLakukan hingga Semua habis. Siapkan wajan Dan goreng hingga kuning kecoklatan.\r\nAngkat dan Siap disajikan', 'Tempe merupakan kreasi hidangan yang unik dan bergizi ditambah tepung menjadi sangat lezat!', , '3', 'pembuka');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(27, 'Bola Tempe Saus Mentega', 'Bahan Bola Tempe:\r\n350 gr tempe\r\n1 butir telur\r\n2 sdm tepung terigu\r\n5 siung bawang putih, haluskan\r\n1 sdt gula\r\n1 sdt garam\r\n1/4 sdt lada bubuk\r\nSecukupnya minyak goreng\r\nBahan Saus Mentega:\r\n3 sdm mentega\r\n1/2 siung bawang bombay, iris panjang\r\n5 siung bawang putih, cincang halus\r\n2 sdm kecap manis\r\n1 sdm saus tiram\r\n1 sdm kecap asin\r\n1 sdt minyak wijen\r\n1/4 sdt garam\r\n1 sdt gula', 'Didihkan air. Potong kecil tempe, rebus sampai empuk. Angkat dan tiriskan.\r\nHaluskan tempe, bisa pake ulekan atau chopper. Masukkan juga bawang putih halus, terigu, telur, gula, garam, dan lada. Aduk rata. Koreksi rasa.\r\nPanaskan minyak goreng. Ambil 1 sendok adonan, bulatkan dengan bantuan 2 sendok. Goreng hingga kuning keemasan. Angkat dan tiriskan.\r\nUntuk sausnya, cairkan mentega. Tumis bawang putih dan bombay hingga wangi.\r\nKecilkan api. Tambahkan kecap manis, saus tiram, kecap asin, minyak wijen, gula dan garam. Aduk rata. Koreksi rasa.\r\nMasukkan bola tempe. Besarkan api, aduk cepat sampai tercampur. Matikan api, bola tempe saus mentega siap dihidangkan.', 'Tempe merupakan kreasi hidangan yang bergizi dan bisa dibuat unik loh, ini contohnya!', , '5', 'pembuka');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(28, 'Tahu cabe garam', '3 Tahu sutra/ tahu putih/ tofu\r\n1 Telur\r\n8 sdm Tepung maezena\r\nDaun bawang\r\n3 Cabe\r\nsdt Lada set\r\nsecukupnya Garam\r\nsdt Kaldu jamur set\r\nBawang bombai\r\n2 Bawang putih', 'Cuci tahunya sampe bersih, kemudian potong2 dadu\r\nKocok telur kemudian kasih garam lada dan kaldu kamur, kemudian campurkan tahunya dan diamkan kurang lebih 10 menit\r\nIris daun bawang, cincang halus bawang putih, iris cabe dan bawang bombay\r\nTuang tepung maezena ke dalam wadah, baluri tahu yang sudah di marinasi dengan telur. Jika sudah semua lalu goreng tahu ke dalam wajan minyak panas. Jika sudah semua angkat dan tiriskan\r\nTumis bawang bombay setengah layu, kemudian masukkan bawang putih tumis sebentar, masukka cabe dan daun bawang, kasih garam secukupnya. Kemudian tuang tahunya dan aduk sebentar, lalu angkat dan jadi dehh', 'Siapa suka tahu pedan yang gurih? Bisa dicoba nih Tahu cabe garam yang menambah nafsu makan!', , '1', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(29, 'Tahu Telur Kecap', 'Bahan Utama\r\n11 buah tahu putih\r\n3 butir telur (ditambah lebih enak)\r\nBumbu Halus\r\n10 buah cabai merah keriting\r\n5 buah cabai hijau keriting\r\n4 buah cabai setan\r\n3 siung bawang merah\r\n2 siung bawang putih\r\nBahan lain\r\n5 sdm kecap manis\r\n1 sdt garam\r\n1/2 sdm gula pasir\r\n1/2 sdt kaldu bubuk', 'Potong tahu. Lalu goreng, jangan terlalu kering.\r\nTumis bumbu halus hingga wangi. Masukkan telur. Aduk. Tambahkan bumbu. Orak-arik hingga tercampur.\r\nMasukkan tahu. Tambahkan kecap manis. Orak-arik lagi. Koreksi rasa.\r\nSajikan dengan nasi hangat', 'Bahannya sangat mudah di dapat loh dan sangat murah, buka kulkasmu pasti ada bahannya!', , '2', 'utama');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(30, 'Tempe Panggang Saus Teriyaki', '127 gr Tempe\r\n10 gr Wortel\r\n10 gr Buncis\r\n36 gr kentang\r\n1/2 sdm garam\r\n1 sdm mayonaise\r\nSecukupnya minyak untuk menggoreng\r\nBumbu Panggang :\r\n5 sdm saus teriyaki instant (me : Pronas)\r\n3 sdm kecap manis\r\n1/2 sdt gula pasir\r\n1 sdm margarine untuk olesan teflon', 'Potong tempe menjadi 2 bagian berbentuk segitiga, kemudian kerat2 tempe agar bumbu bisa meresap\r\nBersihkan buncis dan wortel, kemudian rebus dengan garam hingga empuk. Lalu potong kecil2\r\nPotong2 kentang berbentuk korek api, kemudian goreng hingga matang dan kecoklatan\r\nSiapkan piring/mangkok kemudian campurkan bahan panggang kecuali margarine, kemudian test rasa\r\nPanaskan teflon, beri margarine kemudian masukkan tempe dan masak hingga setengah matang & mulai berubah warna. Bolak-balik disemua sisi nya sampai merata\r\nOlesi tempe dengan bumbu panggang yang sudah disiapkan sebelumnya, kemudian panggang hingga matang\r\nPlatting : letakkan sayuran rebus yg sudah dipotong2 dan tata dipiring, kemudian berikan mayonaise diatas sayuran. Tata kentang dan tempe panggangnya dipiring kemudian tambahkan sedikit bumbu panggang teriyakinya. Sajikan', 'Tempe juga bisa dipanggang loh! Mudah dan simple dibuat hidangan pembuka makanan anda', , '5', 'pembuka');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(31, 'Batagor', 'Bahan isian :\r\nDaging ayam fillet (saya bagian dada&paha)\r\n2 siung bawang putih\r\n4 siung bawang merah\r\n2 batang daun bawang, iris\r\nsecukupnya Garam, merica, kaldu ayam bubuk,\r\n1 sdm saus tiram\r\n1 sdt kecap inggris\r\n1 sdt kecap ikan\r\n4 sdm tepung terigu\r\n8 sdm tepung sagu/tapioka\r\nSedikit air hangat, di campur agar adonan tidak terlalu padat\r\n2 butir telur (saya pakai putihnya saja)\r\nPelengkap :\r\nKulit pangsit\r\nTahu coklat, iris tengahnya\r\nTahu putih besar, potong menjadi 10 bagian\r\nBumbu kacang :\r\n1/4 kg kacang tanah\r\n10-15 buah cabe merah keriting\r\n5 siung bawang putih\r\n4 siung bawang merah\r\n2 keping gula merah\r\nsecukupnya Garam, penyedap\r\nMinyak untuk menumis', 'Chopper : semua bahan isian kecuali tepung, tambahkan tepung dan aduk hingga tercampur\r\nSiapkan minyak untuk menggoreng, masukkan isian ke dalam kulit pangsit, tahu, lalu goreng hingga kuning kecoklatan\r\nBumbu kacang : goreng semua bahan bumbu kacang, kecuali gula jawa\r\nHakuskan semua bahan bumbu kacang, tumis hingga mengeluarkan minyak dan tes rasa\r\nPotong-potong batagor yg sudah di goreng, sirami dengan bumbu kacang beri tambahan kecap+saos sambal (sesuai selera), hidangkan', 'Batagor merupakan jajanan khas Bandung yang mengadaptasi gaya Tionghoa-Indonesia', , '4', 'penutup');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(32, 'Puding Santan Rainbow', '3 bungkus agar-agar swalow putih\r\n2500 ml santan (750 ml santan kara+air)\r\n300 gr gula pasir\r\nPewarna makanan', 'Siapkan wadah besar masukkan semua bahan terkecuali pewarna makanan. Aduk rata\r\nBagi adonan menjadi 5 bagian sama rata. Me per adonan 500ml. Beri warna sesuai selera. Aduk rata.\r\nDidihkan adonan puding warna merah sampai mendidih. Tuang kedalam loyang. Tunggu sampai set. Lakukan seterusnya perwarna dan terakhir warna ungu/taro. Tunggu sampai dingin. Sebelum disajikan masukkan dulu kedalam kulkas. Potong-potong dan sajikan', 'Puding ini sangat mudah dan simple buatnya, cobain dong tinggal klik resepnya loh ya!', , '3', 'penutup');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(33, 'Lekker holland', '200 gr margarin mix butter\r\n140 gr gula halus\r\n1 btr telor\r\nSdikit vanilla eseens\r\n250 gr terigu\r\n1 kuning telor utk olesan\r\nSckupny chocochip,almond slice.', 'Mikser margarin butter bersama gula halus,lalu masukan satu butir telor mikser sampe pucat ya\r\nMasukkan vanilla esseens trkhr masukkan terigu..masukan ke dlm loyang ratakan..\r\nOlesi dgn kuning telor..lalu beri garis2n ya menggunakan garpu trkhr taburi choco n almond slice\r\nPanggang sampe 30 menit..ovenny sdh dpnskn trlbh dahulu ya moms..', 'Lekker holland atau kue pisang Surabaya adalah salah satu makanan khas kota Surabaya.', , '4', 'penutup');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(34, 'Cheese Dessert Box', 'Sponge Cake :\r\n2 butir telur\r\n1 butir kuning telur\r\n60 gr gula pasir\r\n1 sdm susu bubuk\r\n60 gr tepung terigu\r\n1/2 sdt emulsifier / me SP\r\n45 gr butter, lelehkan\r\nCheese Custard :\r\n150 ml susu cair\r\n150 gr keju, parut\r\nSecubit garam\r\n5 gr custard powder / tepung maizena, kurleb 1 sdt\r\nCheese Crakers :\r\nSecukupnya biskuit / crakers / wafer rasa keju, hancurkan', 'Cheese Custarrd : dalam satu panci, masukkan seluruh bahan custard diatas, aduk, masak dengan api kecil hingga meletup2, sisihkan dulu\r\nSponge Cake : dalam wadah mixer, masukkan seluruh bahan sponge cake diatas kecuali butter cair, kocok dengan kecepatan tinggi hingga kental berjejak, lalu masukkan butter cair, aduk lipat hingga benar2 rata\r\nTuang adonan dalam loyang 20x20 yg dialas baking paper, atau boleh pake loyang apa saja sesuai selera, lalu panggang di suhu 180° selama 25 menit, angkat\r\nDinginkan kue, lalu masukkan dalam wadah, bisa dengan 2 cara, cara 1 : cake dipotong2 lalu isi secukupnya dalam box mika, lalu tuang sedikit custard cheese, masukkan lagi potongan kue, lalu custard cheese, terakhir taburi dengan cheese crakers\r\nAtau cara 2, cetak kue sesuai wadah yg kita pakai, lalu tuang custard cheese, masukkan lagi potongan kue utuh yg sudah disesuaikan dengan ukuran box / wadah, tuang lagi custard cheese, lalu terakhir taburi dengan cheese crakers\r\nSimpan dalam kulkas, sajikan dingin', 'Cheese Dessert Box adalah kue yang biasanya dimakan sebagai hidangan penutup terbalut dengan keju', , '5', 'penutup');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(35, 'Pancake durian', 'Kulit pancake :\r\n100 gr tepung terigu\r\n30 gr tepung tapioka\r\n2 putih telur kocok lepas\r\n275 ml susu cair full gream\r\n25 ml air\r\n1 sdm butter cair\r\n1/4 sdt garam\r\n2 tetes pasta pandan\r\nIsian :\r\n300 ml whipping cream\r\n500 gr daging durian haluskan pake garpu\r\n1 sdm gula halus\r\n15 cm ukuran teplon', 'Pertama siapkan bahan untuk isian : mixer whipping cream kasih gula halus mixer sampe mengental masukan kulkas.\r\nPisahkan daging durian dan isian buang. Hancurkan durian pake garpu tes rasa jika kurang manis bisa di tambah susu kental manis lalu masukan kulkas.\r\nBahan kulit : kocok lepas telur masukan ke tepung tuangkan berlahan lahan susu cair aduk pake wisk lalu saring biar tidak terberindil.\r\nPanaskan teflon dengan api kecil, oles tipis dengan butter mengunakan kuas lalu masukan adonan ukuran 1 sendok sayur masukan adonan ke teflon sambil di putar biar tipis rata tunggu sampe mateng bisa di lepas dari teflon.\r\nSetelah di angkat pancake taruk piring di alasi plastik bagian bawah biar kulit pancake tidak lengket di piring lalu bersikan teflon pake kuas oles butter tipis lakukan tuang adonan sampe habis.\r\nAmbil 1 lembar kulit pancake taruk di atas tlenan lebarkan masukan 1 sdm whapping dan 1 sdm daging durian lalu tutup kanan kiri lipat seperti amplop.\r\nLakukan lipat sampe selesai lalu simpan di kulkas 4 jam atau semalaman.\r\nJika masih ada sisa kulit pancake bisa di bungkus plstik simpan di kulkas es bisa tahan 2 minggu.\r\nSajikan selagi dingin dan selamat menikmati\r\nSelamat mencoba semoga menyenangkan ', 'Makanan ringan berupa puree daging durian dan vla atau krim kocok yang dibalut dengan kulit crepes atau dadar gulung.', , '5', 'penutup');
INSERT INTO `resep` (`idResep`, `namaResep`, `bahan`, `prosedur`, `description`, `foto`, `rating`, `kategori`) VALUES
(36, 'Brownies Goreng', '100 gr tahu kulit, goreng/ keringkan dioven, blender\r\n75 gr gula pasir\r\n1 butir telur\r\n60 gr terigu, sy Kunci Biru\r\n25 gr cokelat bubuk\r\n80 gr DCC /Dark Cooking Cokelat\r\n50 gr butter\r\n1/2 sdt baking powder\r\n1/4 sdt garam\r\n1/4 sdt vanili bubuk\r\nToping :\r\nsesuai selera Chocochips/', 'Panaskan oven terlebih dahulu di suhu 180 dercel\r\nAlasi loyang dengan kertas roti/sy pake loyang loaf uk 10 x 20 cm\r\nSiakpan bahan. Campur butter dan DCC, tim sampai meleleh.Campur terigu, cokelat bubuk, baking powder dan vanili bubuk\r\nKocok telur dan gula pasir sampai gula larut sekitar 1,5 menit dengan speed mixer sedang.\r\nMatikan mixer, masukkan campuran terigu, aduk rata dg spatula\r\nMasukkan tahu, aduk rata\r\nMasukkan campuran DCC, butter dan garam, aduk rata\r\nTuang ke dalam loyang\r\nPanggang selama 20-25 menit, angkat, dinginkan\r\n', 'Brownies merupakan makanan yang dipanggang atau dikukus yang berbentuk persegi atau datar yang lembutnya membuat mulut meleleh', , '4', 'penutup');

